                <div className="col-4">
                <button className="get-playlist" onClick={() => getPlaylist} >
                    Get Playlist...
                </button>
                </div>
                <div className="col-4">
                    <button className="get-recent" onClick={() => getRecents} >
                    Get Recents...
                  </button>
                </div>
            </div>
        </div>
    )
}

export default Stream
